import React, { Component } from 'react';

import { ThemeContext } from '../public/context';

export default class contextPage extends Component{
    static contextType = ThemeContext;

    render() {
        const { value } = this.props;
        console.log(value);
        return (
            <div>{value.color}</div>
        )
    }
}
